import './Expenses.css'
import ExpenseItem from './ExpenseItem'

function Expenses(props) {

    return (
        <div className='expenses'>
            {props.data.length > 0 && props.data
            .map(ei => <ExpenseItem
            id={ei.id}
            title={ei.title}
            amount={ei.amount}
            date={ei.date} />)
            }    
        </div>
    )
}

export default Expenses
